__NUXT_JSONP__("/svet/mesto/tamakautoga--stat-tokelau", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v){return {data:[{place:[{id:i,id_state:j,name:k,population:500,area:2.47,altitude:l,slug:m,information_chatgpt:a,coordinates:[{latitude:-9.1,longitude:-171.7833}],biggest:"yes",type_place:c,id_image_cover:a,id_image_hero:a,affiliate:[{name:n,value:o}],alerts:a,zoom:[{google:p,booking:11}],parking:a,information_author:a,importance:d,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2023-12-27T17:06:48.496338+00:00"}],imagePlace:[],placeState:[{tld:".tk",name:q,area:p,population:1501,slug:g,id_continent:e,information_chatgpt:"\u003Cp\u003ETokelau je tichomořským ostrovním teritoriem, které se skládá z tří atolů a několika menších ostrůvků. Nachází se v jihozápadní části Tichomořského oceánu a je administrativně řízeno z Nového Zélandu. Ostrovy mají původní polynéskou kulturu a jsou známy svou krásnou přírodou a tichým, odpočinkovým prostředím.\u003C\u002Fp\u003E\n\u003Cp\u003ETokelau má pouze asi 1 400 obyvatel a cestování sem je poměrně náročné. Neexistuje zde letiště a návštěvníci sem musí cestovat lodí z ostrova Samoa. Avšak ti, kteří se rozhodnou navštívit Tokelau, budou odměněni krásnými bílými písečnými plážemi, tyrkysově modrou vodou a nádhernými korálovými útesy.\u003C\u002Fp\u003E\n\u003Cp\u003ETokelau je také známo svou tradiční kulturou a zvyky, jako je například taneční forma zvaná \"Faka Tokelau\", kterou místní tanečníci provádějí v barevných oblecích a doprovázeni bubny. Kromě toho jsou zde k dispozici různé turistické aktivity, jako jsou potápěčské výlety k nejlepším místům pro pozorování podmořského života a výlety na kole nebo pěší výlety na ostrovech.\u003C\u002Fp\u003E\n\u003Cp\u003EProtože Tokelau je poměrně malé území s omezenými zdroji, jsou zde nabízeny pouze základní turistické služby a infrastruktura. Návštěvníci by se měli připravit na to, že zde nenajdou luxusní hotely nebo velké nákupní centra, ale na druhé straně si užijí klid a odpočinek v krásné přírodě, daleko od každodenního ruchu velkých měst.\u003C\u002Fp\u003E",currency_code:"NZD",currency_name:"Novozélandský dolar",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:15,date_update:b},{name:"Chleba",value:f,date_update:b},{name:"Mléko",value:l,date_update:b},{name:"Voda (500ml)",value:1,date_update:b},{name:"Espresso",value:4,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:2,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:f,date_update:b}],phone_numbers_emergency:a,phone_prefix:"+690",coordinates:[{latitude:r,longitude:s},{latitude:r,longitude:s}],people_religion:a,people_nationality:a,visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Tokelau není občanský průkaz platným cestovním dokladem. Je třeba mít platný cestovní pas.",date_update:b},{name:"Cestovní pas",value:"Pro vstup do Tokelau je třeba mít platný cestovní pas.",date_update:b},{name:"Vízum",value:"Pro občany České republiky není potřeba mít vízum při vstupu do Tokelau. Nicméně, vstupní povolení (Entry Permit) je nutné získat před příjezdem a platnost tohoto povolení je omezena na 90 dní. Ostatní státní příslušníci se mohou muset žádat o vízum před příjezdem do Tokelau.",date_update:b},{name:"Očkování",value:"Při vstupu do Tokelau není nutné mít žádné specifické očkování. Nicméně, cestovatelé by měli být očkováni proti běžným chorobám jako jsou tetanus, spála, zarděnky a hepatitida A a B. Doporučuje se také očkování proti žluté zimnici pro ty, kteří přicházejí z oblastí, kde je tato choroba rozšířena.",date_update:b},{name:"Cestovní pojištění",value:"Cestovní pojištění není povinné pro vstup do Tokelau, ale silně se doporučuje. Zdravotní péče v Tokelau je omezená a v případě vážného zranění nebo nemoci by bylo třeba být převezen do zdravotnického zařízení v jiné zemi, což může být velmi drahé.",date_update:b},{name:"Bezpečnostní situace",value:"Tokelau je velmi bezpečnou destinací a kriminalita zde není rozšířená. Vzhledem k odlehlosti ostrovů a omezenému přístupu se však doporučuje být obezřetný a neopouštět hlavní město nebo osady v noci bez doprovodu místních průvodců.",date_update:b},{name:"Další informace",value:"Vzhledem k odlehlosti a omezeným zdrojům je v Tokelau velmi omezený rozsah služeb a zařízení. Turisté by si měli být vědomi, že zde není žádná banka nebo bankomat a platby se často uskutečňují hotově. Turisté by také měli respektovat místní kulturu a zvyklosti a být připraveni na omezené možnosti stravování a ubytování.",date_update:b}],type_place:t,id_image_cover:h,id_image_hero:h,id_city_main:u,affiliate:[{name:n,value:o}],mpz:"TK",alerts:a,zoom:[{google:v,booking:v}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:j,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2023-12-27T17:07:31.480426+00:00"}],imageState:[{id:h,name:g,source:"\u002Fworld\u002Fstates\u002F",type:t,author:"commons.wikimedia.org\u002Fwiki\u002FFile:Fakaofo_Atoll.jpg",created_at:"2023-05-06T09:27:42.033044+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:e,slug:"australie-a-oceanie",name:"Austrálie a Oceánie",area:8560000,population:42000000,population_density:4.9,number_states:14,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E je kontinent, které se nachází na jižní polokouli. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E je největší zemí v Oceánii, zatímco Oceánie zahrnuje mnoho ostrovů v Tichomoří, včetně \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nové Guiney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsamoa\"\u003ESamoa\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETongy\u003C\u002Fa\u003E\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie\u003C\u002Fb\u003E je známá svými exotickými zvířaty, jako jsou \u003Cb\u003Eklokani\u003C\u002Fb\u003E, \u003Cb\u003Ekoaly\u003C\u002Fb\u003E a \u003Cb\u003Eemuové\u003C\u002Fb\u003E. Je také domovem mnoha překrásných pláží, kde se lze slunit, surfovat a potápět. Nejznámějšími městy jsou \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E je známé svým \u003Cb\u003Eoperním domem\u003C\u002Fb\u003E a \u003Cb\u003EHarbour Bridge\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E je považováno za kulturní centrum a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E je ideální pro milovníky adrenalinových sportů, jako je rafting a skákání padákem.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENový Zéland\u003C\u002Fa\u003E\u003C\u002Fb\u003E, má jedinečnou přírodu a kulturu. Nachází se zde mnoho přírodních památek, včetně hor, jezer a národních parků. Země je také domovem mnoha původních \u003Cb\u003EMaorů\u003C\u002Fb\u003E a jejich kultury. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fauckland\"\u003EAuckland\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fwellington\"\u003EWellington\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší města na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, zatímco \u003Cb\u003EQueenstown\u003C\u002Fb\u003E je oblíbená destinace pro turisty hledající adrenalinové sporty a krásnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E je jednou z nejvíce odlehlých a exotických destinací na světě. Země je plná původních kmenů a mnoha z nich si stále zachovávají tradiční zvyky a rituály. Turisté sem jezdí kvůli krásným plážím a překrásné přírodě. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fport-moresby\"\u003EPort Moresby\u003C\u002Fa\u003E\u003C\u002Fb\u003E je hlavním městem země a láká návštěvníky svými muzei a historickými památkami.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E je také známá svými neuvěřitelnými korálovými útesy a podmořským životem. Korálové útesy \u003Cb\u003EVelký bariérový útes\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší na světě a lákají milovníky potápění z celého světa. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETonga\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou další oblíbené destinace pro potápěče a snorkelisty.\u003C\u002Fp\u003E\u003Cp\u003EMezi další známé ostrovy v \u003Cb\u003EOceánii\u003C\u002Fb\u003E patří \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E, které jsou součástí USA. \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E jsou známé svými surferskými plážemi, sopkami a krásnou přírodou. \u003Cb\u003ETahiti\u003C\u002Fb\u003E, největší ostrov \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, láká návštěvníky svými luxusními resorty, bílými plážemi a modrými lagunami. \u003Cb\u003EBora Bora\u003C\u002Fb\u003E, jeden z ostrovů \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je oblíbený mezi páry hledající romantickou dovolenou.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E má také bohatou historii a kulturu původních obyvatel. Původní obyvatelé \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EMaorové\u003C\u002Fb\u003E, mají svou vlastní kulturu a jazyk. V \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou původní obyvatelé \u003Cb\u003EAboridžinci\u003C\u002Fb\u003E, kteří mají svůj vlastní jazyk, tradice a umění. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho různých původních kmenů, z nichž každý má své vlastní tradice a jazyk.\u003C\u002Fp\u003E\n\u003Cp\u003ECo se týče cestování do \u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E, musí cestovatelé získat víza pro vstup do země, pokud je to požadováno. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho mezinárodních letišť, zatímco v \u003Cb\u003EOceánii\u003C\u002Fb\u003E jsou letiště menší a mohou být omezenější. Mnoho ostrovů v \u003Cb\u003ETichomoří\u003C\u002Fb\u003E má také přísné pravidla pro dovoz zahraničních rostlin a zvířat, aby se chránila původní ekologie.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E a na mnoha ostrovech v \u003Cb\u003EOceánii\u003C\u002Fb\u003E se můžete potkat s tropickým klimatem s teplými lety a mírnými zimami. V některých částech \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E však může být klima velmi suché a horké, zatímco na jiných místech může být velmi vlhké a deštivé.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E jsou také oblíbenými destinacemi pro adrenalinové sporty, jako je potápění, surfování, skákání padákem, rafting a další. Mnoho turistů také navštěvuje \u003Cb\u003EAustrálii a Oceánii\u003C\u002Fb\u003E kvůli sportovním akcím, jako jsou tenisové turnaje v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nebo ragbyové zápasy na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003Cb\u003E.\u003C\u002Fp\u003E",coordinates:[{latitude:-25.274398,longitude:133.775136}],type_place:"continent",id_image_cover:e,id_image_hero:e,zoom:[{google:f,booking:f}],information_author:a,seo_tags:a,created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2023-12-27T17:07:06.531847+00:00"}],placesCities:[{id:u,id_image_cover:a,importance:d,slug:"atafu",type_place:c,name:"Atafu"},{id:2177,id_image_cover:a,importance:d,slug:"coral-gardens",type_place:c,name:"Coral Gardens"},{id:2173,id_image_cover:a,importance:d,slug:"fakaofo",type_place:c,name:"Fakaofo"},{id:2182,id_image_cover:a,importance:d,slug:"fenua-tapu",type_place:c,name:"Fenua Tapu"},{id:2180,id_image_cover:a,importance:d,slug:"nukufetau",type_place:c,name:"Nukufetau"},{id:2175,id_image_cover:a,importance:d,slug:"nukunonu",type_place:c,name:"Nukunonu"},{id:2179,id_image_cover:a,importance:d,slug:"talikoti",type_place:c,name:"Talikoti"},{id:i,id_image_cover:a,importance:d,slug:m,type_place:c,name:k},{id:2178,id_image_cover:a,importance:d,slug:"teafua",type_place:c,name:"Teafua"},{id:2176,id_image_cover:a,importance:d,slug:g,type_place:c,name:q}],imagesCities:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:[]}}(null,"05-2023","city","biggest",6,3,"tokelau",436,2181,220,"Tamakautoga",5,"tamakautoga--stat-tokelau","booking",true,10,"Tokelau","-9.2000","-171.8000","state",2174,8)));